import React, { useState, useEffect } from 'react';
import { useAuth } from '../context/AuthContext';
import { companyService } from '../services/api';
import { useNavigate } from 'react-router-dom';
import ProjectManagement from './ProjectManagement';
import ChatInterface from './ChatInterface';
import CompanyDashboard from './CompanyDashboard';
import './Dashboard.css';

const Dashboard = () => {
  const [company, setCompany] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [activeTab, setActiveTab] = useState('overview');

  const { logout } = useAuth();
  const navigate = useNavigate();

  useEffect(() => {
    fetchCompanyData();
  }, []);

  const fetchCompanyData = async () => {
    try {
      const data = await companyService.getCompany();
      setCompany(data);
    } catch (err) {
      if (err.response?.status === 404) {
        setError('Company data not found. Please complete setup first.');
      } else {
        setError('Error loading company data.');
      }
    } finally {
      setLoading(false);
    }
  };

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  if (loading) {
    return (
      <div className="loading">
        <div className="spinner"></div>
      </div>
    );
  }

  return (
    <div className="dashboard-wrapper">
      <div className="dashboard-header">
        <h1>Company Dashboard</h1>
        <button onClick={handleLogout} className="btn logout-btn">
          Logout
        </button>
      </div>

      {error ? (
        <div className="card text-center error-message">
          <h2>Error</h2>
          <p>{error}</p>
          <button onClick={() => navigate('/company-setup')} className="btn btn-primary">
            Setup Company
          </button>
        </div>
      ) : (
        <>
          {/* Tabs */}
          <div className="tabs">
            {[
              { key: 'overview', label: 'Overview' },
              { key: 'company', label: 'Company Info' },
              { key: 'requests', label: 'Customer Requests' },
              { key: 'chat', label: 'Chat' },
              { key: 'company-dashboard', label: 'AI Dashboard' },
              { key: 'api', label: 'API Key' },
            ].map((tab) => (
              <button
                key={tab.key}
                onClick={() => setActiveTab(tab.key)}
                className={`tab-btn ${activeTab === tab.key ? 'active' : ''}`}
              >
                {tab.label}
              </button>
            ))}
          </div>

          {/* Tab content */}
          <div className="tab-content">
            {activeTab === 'overview' && (
              <div className="grid grid-3">
                <InfoCard title="Company Name" value={company?.name || 'N/A'} />
                <InfoCard title="Industry" value={company?.industry || 'N/A'} />
                <InfoCard title="Requests" value={company?.requests?.length || 0} />
              </div>
            )}

            {activeTab === 'company' && <CompanyInfo company={company} onUpdate={fetchCompanyData} />}
            {activeTab === 'requests' && <CustomerRequests company={company} onUpdate={fetchCompanyData} />}
            {activeTab === 'chat' && <ChatInterface />}
            {activeTab === 'company-dashboard' && <CompanyDashboard />}
            {activeTab === 'api' && <ApiKeyInfo company={company} />}
          </div>
        </>
      )}
    </div>
  );
};

// --- Small reusable components ---
const InfoCard = ({ title, value }) => (
  <div className="card text-center">
    <h3>{title}</h3>
    <p>{value}</p>
  </div>
);

const ApiKeyInfo = ({ company }) => {
  const [copied, setCopied] = useState(false);
  const copyToClipboard = () => {
    navigator.clipboard.writeText(company?.apiKey || '');
    setCopied(true);
    setTimeout(() => setCopied(false), 2000);
  };

  return (
    <div className="card">
      <h2>API Key</h2>
      <div className="api-key-section">
        <input type="text" value={company?.apiKey || ''} readOnly />
        <button onClick={copyToClipboard} className="btn btn-secondary">
          {copied ? 'Copied!' : 'Copy'}
        </button>
      </div>
    </div>
  );
};

export default Dashboard;
